import React from 'react';
import Banner from './Banner.PNG';
import './welcome.css';
import contact from './contact.png';
import transaction from './transaction.png';
import login from './login.png';
import writhdraw from './withdraw.png';


const Welcomepage = () => {
  return (
    <div>
      <div className='banner'>
        <img src={Banner} className="App-banner" class="img-fluid" alt="banner"/>
      </div>
      <div className = 'transaction'>
        <img src={transaction} className="transaction"  class="rounded float-start" alt="banner"/>
      </div> 
      <div className = 'withdraw'>
        <img src={writhdraw} className="withdraw" class="rounded float-start" alt="banner"/>
      </div>
      <div className = 'login'>
        <img src={login} className="login"  class="rounded float-start" alt="banner"/>
      </div>
      <div className = 'contact'>
        <img src={contact} className="contact"  class="rounded float-start" alt="banner"/>
      </div>
    </div> 
  );
};

export default Welcomepage;
